package com.unis.kevin.vo;

/**
 * @author founder
 *
 */
public class KindVO {

	/**
	 * 
	 */
	public KindVO() {
		// TODO Auto-generated constructor stub
	}
	
	private int kindId;
	private String kindName;
	private String kindDescribe;
	private int kindDisplay;
	public int getKindId() {
		return kindId;
	}
	public void setKindId(int kindId) {
		this.kindId = kindId;
	}
	public String getKindName() {
		return kindName;
	}
	public void setKindName(String kindName) {
		this.kindName = kindName;
	}
	public String getKindDescribe() {
		return kindDescribe;
	}
	public void setKindDescribe(String kindDescribe) {
		this.kindDescribe = kindDescribe;
	}
	public int getKindDisplay() {
		return kindDisplay;
	}
	public void setKindDisplay(int kindDisplay) {
		this.kindDisplay = kindDisplay;
	}

}
